* Syntax:
* let <i> = <x> <sign> <y>;
* Where:
* - <i> := [a-z]([1-9] | [a-z])*
* - <x> := [0-9];
* - <y> := [0-9];
* - <sign> := + | *; * Check [here](./compiler_primer.md#2-parsing) for AST defintion
*/
