Some(Token::EqualSign) => (),
_ => return Err(format!("Failed to parse '=' at {token_ptr}")) } // move on to next token token_ptr += 1; /*parse left side of expr*/ let left = match tokens.get(token_ptr) { Some(left @ Token::IntLiteral(_)) => left, _ => return Err(format!("Failed to parse integer literal at {token_ptr}")) } // move on to next token token_ptr += 1; /* parse sign (+ or *) */ let sign = match tokens.get(token_ptr) { Some(Token::Plus) => Sign::Add Some(Token::Asterisk) => Sign::Mult _ => return Err(format!("Failed to parse + or * at {token_ptr}")) } // move on to next token token_ptr += 1; /*parse right side of expr*/ let right = match tokens.get(token_ptr) { Some(right @ Token::IntLiteral(_)) => right, _ => return Err(format!("Failed to parse integer literal at {token_ptr}")) } // move on to next token token_ptr += 1; /* parse semi colon*/ match tokens.get(token_ptr) { Some(Token::SemiColon) => (), _ => return Err(format!("Failed to parse '=' at {token_ptr}")) } // move on to next token token_ptr += 1; // if there any tokens besides these, error if token_ptr != tokens.len(){ return Err("There were too many tokens") } Ok(AST { let_kw: Token::LetKw, var_ident, equals_sign: Token::EqualSign, body: Expr { left, sign, right, } semicolon: Token::SemiColon }) } There are a bunch of obvious problems with this implementation: Precise manipulation of a pointer to tokens might foment logic errors, since it gives us a lot of freedom, especially if we ever need to backtrack Very repetitive code. We could make it smaller with some abstractions, but it would still be quite repetitive for larger, more complex syntaxes. No mechanism for reusing Now, imagine a syntax like Rust's . Building parsing functions for it is a tremendously difficult job that grows quickly.

